import React from 'react';
import StudentForm from './StudentForm';

import MarksForm from './MarksForm';

import GetStudentMarksForm from './GetStudentMarksForm';

import UpdateMarksForm from './UpdateMarksForm';

import GetStudentGradeForm from './GetStudentGradeForm';
const App = () => {
  return (
    <div className="app">
      <header>
        <h1>Student Information</h1>
      </header>
      <main>
        <section>
          <h2>Add Student</h2>
          <StudentForm />
        </section>
        <section>
          <h3>Marks</h3>
          <MarksForm/>
        </section>
        <section>
          <h4>Get student marks</h4>
          <GetStudentMarksForm />
        </section>
        <section>
          <h5>Update student marks</h5>
          <UpdateMarksForm/>
        </section>
        <section>
        <h6>Get Student Grade</h6>
        <GetStudentGradeForm/>
        </section>
      </main>
    </div>  
  );
};

export default App;
